import $ from 'jquery';
import React from 'react';
import logo from './logo.svg';
import './App.css';

import { Container } from "semantic-ui-react"


class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      items: []
    };
    this.serverRequest = this.serverRequest.bind(this);
    this.serverRequest();
  }

  serverRequest(){
    $.get("http://localhost:5000/api/logs/items", res => {
      console.log(res);
      this.setState({
        items: res
      },()=>{
        console.log(this.state.items[0].name)
      });
    });
  }
  componentDidMount(){
    this.serverRequest();
    console.log(this.state.items[2])
  }
  render() {
    console.log("we will render now")
    return (
      <div className="App">
        <div className="ui inverted top fixed menu">
          <div className="ui container">
            <a className="header item">
              ai
            </a>
            {console.log(this.state.items[3])}
            <a className="active item">Home</a>
            <a className="item">Logs</a>
            <a className="item">Export</a>
         </div>  
       </div>
     </div>  
    )
  }
}

function ItemTable(props) {
  return (
    <div className="ui container">
      <table className="ui table">
        <tr>
          <th>Hay</th>
        </tr>
        {props.items.map(function(item, i) {
          return <Item item={item} />;
        })}
      </table>
    </div>  
  )
}

function Item(props) {
  return (
    <tr>
      <td>{props.item.name}</td>
    </tr>
  )
}

export default App;
